message:
Add support for context.Context automatic Quit() (#31)

It's annoying if you interrupt tests to have them leave a browser
window open.

You might have to wait a while before you can run your tests again.

This adds support for go 1.7's `context.Context`. It instruments all
requests, causing them to cancel the outgoing HTTP request to selenium
if the context is canceled.

In addition, it checks on entry and exit to a HTTP request if the
context is canceled, to ensure we notice rapidly.

If the context is canceled, `wd.Quit()` is called. For convenience, it's
made legal to call quit more than once, so that code which does:

```go
wd := makeWD()
defer wd.Quit()
```

Remains legal.

An example of use:

```go
var cancel func()
ctx, cancel = context.WithCancel(context.Background())
go func() {
	interrupt := make(chan os.Signal)
	signal.Notify(interrupt, os.Interrupt)
	<-interrupt
	log.Printf("Received interrupt.")
	cancel()
}()

wd := makeWD()
wd.SetContext(ctx)

wd.Get(...)
... etc, etc.
```

The net effect is that interrupting the tests now give `X failed:
canceled`, and the browser window quits.
diff --git a/remote.go b/remote.go
index 1557a4a..54c0560 100644
--- a/remote.go
+++ b/remote.go
@@ -7,6 +7,7 @@ package selenium

 import (
 	"bytes"
+	"context"
 	"encoding/base64"
 	"encoding/json"
 	"errors"
@@ -17,6 +18,7 @@ import (
 	"net/http/httputil"
 	"os"
 	"strings"
+	"sync"
 )

 var Log = log.New(os.Stderr, "[selenium] ", log.Ltime|log.Lmicroseconds)
@@ -56,6 +58,14 @@ type remoteWebDriver struct {
 	capabilities Capabilities
 	// FIXME
 	// profile             BrowserProfile
+	ctx context.Context
+
+	haveQuitMu sync.Mutex
+	haveQuit   bool
+}
+
+func (wd *remoteWebDriver) SetContext(ctx context.Context) {
+	wd.ctx = ctx
 }

 func (wd *remoteWebDriver) url(template string, args ...interface{}) string {
@@ -73,7 +83,29 @@ func (wd *remoteWebDriver) send(method, url string, data []byte) (r *reply, err
 	return
 }

-func (wd *remoteWebDriver) execute(method, url string, data []byte) ([]byte, error) {
+// ErrCanceled is returned when the context is cancelled.
+var ErrCanceled = errors.New("cancelled")
+
+func (wd *remoteWebDriver) execute(method, url string, data []byte) (buf []byte, err error) {
+	select {
+	case <-wd.ctx.Done():
+		err = ErrCanceled
+		wd.ctx = context.Background()
+		_ = wd.Quit()
+		return
+	default:
+	}
+	defer func() {
+		select {
+		case <-wd.ctx.Done():
+			err = ErrCanceled
+			wd.ctx = context.Background()
+			_ = wd.Quit()
+			return
+		default:
+		}
+	}()
+
 	if Log != nil {
 		Log.Printf("-> %s %s [%d bytes]", method, url, len(data))
 	}
@@ -92,6 +124,8 @@ func (wd *remoteWebDriver) execute(method, url string, data []byte) ([]byte, err
 		}
 	}

+	req = req.WithContext(wd.ctx)
+
 	res, err := httpClient.Do(req)
 	if err != nil {
 		return nil, err
@@ -103,7 +137,7 @@ func (wd *remoteWebDriver) execute(method, url string, data []byte) ([]byte, err
 		}
 	}

-	buf, err := ioutil.ReadAll(res.Body)
+	buf, err = ioutil.ReadAll(res.Body)
 	if err != nil {
 		return nil, err
 	}
@@ -194,7 +228,11 @@ func NewRemote(capabilities Capabilities, executor string) (WebDriver, error) {
 		executor = defaultExecutor
 	}

-	wd := &remoteWebDriver{executor: executor, capabilities: capabilities}
+	wd := &remoteWebDriver{
+		executor:     executor,
+		capabilities: capabilities,
+		ctx:          context.Background(),
+	}
 	// FIXME: Handle profile

 	_, err := wd.NewSession()
@@ -318,6 +356,18 @@ func (wd *remoteWebDriver) ActivateEngine(engine string) (err error) {
 }

 func (wd *remoteWebDriver) Quit() (err error) {
+	wd.haveQuitMu.Lock()
+	defer wd.haveQuitMu.Unlock()
+	if wd.haveQuit {
+		// Double-Quit is an error-free no-op.
+		return nil
+	}
+	wd.haveQuit = true
+	// Quit is the one method which cannot be canceled.
+	// It's also the last thing that happens in a webdriver, so we can
+	// kill the context here.
+	wd.ctx = context.Background()
+
 	if _, err = wd.execute("DELETE", wd.url("/session/%s", wd.id), nil); err == nil {
 		wd.id = ""
 	}
diff --git a/selenium.go b/selenium.go
index a85cc78..7a3c9db 100644
--- a/selenium.go
+++ b/selenium.go
